import React, {Component} from 'react';
import {  Container , Button, Jumbotron } from 'react-bootstrap';
import './Home.css';
import firebaseApp from 'firebase/app';
import 'firebase/auth';;



export default class Home  extends Component {

    checkUserLogin() {
        var user = firebaseApp.auth().currentUser;
            if (user) {
                console.log("there is a user signed in");

            } else {
                console.log("there is NOT a user signed in");
            }
    }

    render() {
        return (
            this.checkUserLogin(),
            <Container >
                     <Jumbotron>
                         <h2>Welcome to Cloud and Back Personal Tracker!</h2>
                         <p>Here you will be able to monitor you different monitoring devices.</p>
                     </Jumbotron>
                     <Button  onClick={() => this.props.history.push('/About')}>About</Button>
                 </Container >
        )
    }
}
